import React from 'react'
import PropTypes from 'prop-types';
import '../styles/nav.scss';

export const Nav = ({itemsNav}) => {
    return (
        <img className="icon" src="userIcon.svg" alt="userIcon"/>
    );
};

Nav.propTypes = {
    itemsNav: PropTypes.array
  };
  
  Nav.defaultProps = {
    itemsNav: null,
  };
